  null,\n\t\"notes\": \"This dataset has 5-day Currents data from thenTAO/TRITON (Pacific
  Ocean, http://www.pmel.noaa.gov/tao/),nRAMA (Indian Ocean, http://www.pmel.noaa.gov/tao/rama/),
  andnPIRATA (Atlantic Ocean, http://www.pmel.noaa.gov/pirata/)narrays of moored buoys
  which transmit oceanographic and meteorological data to shore in real-time via the
  Argos satellite system.  These buoys are major components of the CLIVAR climate
  analysis project and the GOOS, GCOS, and GEOSS observing systems.  5-day data is
  an average of daily values collected during consecutive five day intervals.  A minimum
  of 2 daily values are required to compute a 5-day average.  This dataset contains
  realtime and delayed mode data (see the 'source' variable).  For more information,
  seenhttp://www.pmel.noaa.gov/tao/proj_over/proj_over.html .\",\n\t\"license_title\":
